objet:
participer aux activités de l'école quand celle-ci en émet le souhait ; améliorer le cadre de vie des élèves ; 
aider à la réalisation des projets pédagogiques de l'école ; 
fournir du matériel pédagogique aux enseignants ; 
proposer des activités ludiques, culturelles ou sportives aux élèves de l'école ; 
aider les enfants des familles défavorisées à participer à toutes les activités de l'école ;
organiser des actions de financement conjointes avec l'école permettant de réaliser les objectifs de l'association

maintenir et développer des liens entre la communauté des habitants de l'archipel de Saint Pierre et Miquelon, le Pays Basque et la communauté basque de l'étranger ; elle s'attachera plus particulièrement à : 
- aider au développement et à la cohésion des entités du territoire agissant en relation avec le Pays Basque, son histoire, sa culture, ses sports, son économie ; 
- participer elle même à la création et au développement de nouvelles activités sociales ou économiques en relation avec le Pays Basque et sa diaspora
- participer, sur son territoire, à une meilleure connaissance et à la promotion du Pays Basque 
- apporter aide, assistance et protection aux basques qui en feraient la demande et favoriser leur mise en relation avec les administrations publiques basques ; 
Plus généralement, aider à développer les relations entre ses adhérents, le territoire d'origine du Pays Basque et sa communauté internationale
